import osimport timefrom selenium import webdriverfrom bs4 import BeautifulSoupfrom selenium.webdriver.chrome.options import Optionsimport osimport datetimefrom datetime import datetimefrom datetime import dateimport pandas as pdos.chdir('/Users/glenhigh/Scrapping/OPERA_options_pricing')def trade_date_to_unix(date):    if date[16]=='P':        hh=int(date[11:13])        if hh==12:            hh="00"        else:            hh+=12        mm=(date[14:16])        res=(f"{date[0:11]}{hh}:{mm}")    else:        res=(date[0:15])    return int(datetime.strptime(res, '%Y-%m-%d %H:%M').strftime("%s"))print(trade_date_to_unix("2021-11-11 12:03PM EST"))full_call=pd.read_csv('/Users/glenhigh/Scrapping/OPERA_options_pricing/Market_data/Calls_AAPL_Last.csv')full_call['Last Trade Date']=full_call['Last Trade Date'].apply(trade_date_to_unix)print(full_call['Last Trade Date'])